import React from 'react'
import {Collapse} from 'react-collapse';

const Collaps = () => {
    return (
        <Collapse theme={{collapse: 'foo', content: 'bar'}}>
        <div>Customly animated container</div>
        </Collapse>
      );
}

export default Collaps
